import axios from 'axios';
import Link from 'next/Link'

 function listwords({ words }) {

  console.log(words)
    return (
        <div>

        {words.tempDoc.map(function(item, i){

             return  <ul><Link  href='/definitions/[def]' as={`definitions/${item.word}`}><a>{item.word}</a></Link></ul>
            })}
      </div>
      )
}

export async function getServerSideProps() {

   const wordlist = await axios.get(`http://localhost:5050/api/words`,{ headers: { 'Content-Type': 'application/json' } })

    return {

      props: {
       words: wordlist.data
      }
    }
  }


export default listwords
